import React, { useState } from "react";

export const Signin = (props) => {
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');

    const handleSubmit = (e) => {
        e.preventDefault();
    }
    return (
        <>
            <form onSubmit={handleSubmit}>
                <label htmlFor="email">Email: </label>
                <input value={email} type="email" placeholder="example@gmail.com" />
                <label htmlFor="password">Password: </label>
                <input value={password} type="password" placeholder="**********" />
                <button type = "submit">Log In!</button>
            </form>
            <button onClick={() => props.onFormSwitch('Signup')}>If you don't already have an account, register here!</button>
        </>
    )
}
